INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1, 1001, 2, "春咲 ひより", "ねぇねぇ、騎士クン\n手伝ってあげようよ～", "お！\nあそこに困ってそうな人発見！", 0, 1, 0, 0, 1, 1.4, 0, 0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1, 1002, 2, "草野 優衣", "わ、わたし、\nなに言ってるんだろ\nあはは…", "大切な人を\n守れるようになりたい…って", 0, 1, 0, 0, 1, 1.4, 0, 0, "みんなみたいに\nわたしも強くならなきゃ");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1, 1003, 2, "士条 怜", "少しは磨かれると思いますよ。", "キミに必要な集中力と感性が", 0, 1, 0, 0, 1, 1.4, 0, 0, "フェンシングを始めてみては？");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1, 1004, 2, "穂高 みそぎ", "みそぎはねぇ、\nかくれんぼやりたい！", "今日はなにして遊ぶ？", 0, 1, 0, 0, 1, 1.5, 0, 0, "ねぇ、にいちゃん！");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1, 1006, 2, "風宮 あかり", "私といっしょに…\nいかない？", "ねぇ…", 0, 1, 0, 0, 1, 1.4, 0, 0, "風宮あかりです");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1, 1007, 2, "出雲 宮子", "食べ物の恨みは怖いのー", "プリンたべたいのー", 0, 1, 0, 0, 1, 1.5, 0, 0, "出雲宮子なのー");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1, 1008, 2, "虹村 雪", "いいよ。\n見られることは運命さ…", "キミもボクの美貌に\n吸い寄せられたんだね。", 0, 1, 0, 0, 1, 1.4, 0, 0, "ボクは虹村雪。");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1, 1009, 2, "柊杏奈", "人呼んで「疾風の冥姫」!!", "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0, 1, 0, 0, 1, 1.4, 0, 0, "フッ…聞いて後悔するがいい！");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1, 1010, 2, "姫宮 真歩", "ほんまおおきにやわ～♪", "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0, 1, 0, 0, 1, 1.5, 0, 0, "マホマホ王国のプリンセス、\nまほ姫どす");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1, 1011, 2, "衣之咲 璃乃", "ここで会ったが\n100年目～！", "生き別れたお兄ちゃんを探して\n三千世界！", 0, 1, 0, 0, 1, 1.4, 0, 0, "衣之咲璃乃です！");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1, 1012, 2, "柏崎 初音", "…って、お願い！\n誰にも言わないでおいて～！", "ち、超能力って…\n何のことかな～？", 0, 1, 0, 0, 1, 1.4, 0, 0, "私はハツネ、\n結構強いんだよ。\nきらーん☆");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1, 1016, 2, "美波 鈴奈", "ヒデサイまぢ\nGF（グッドフィーリング）～♪", "一応カリスマ読モJKやってまっす！", 0, 1, 0, 0, 1, 1.4, 0, 0, "ちょす！\n美波鈴奈だよ～♪");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1, 1017, 2, "喜屋武 香織", "でも、沖縄もとってもいいとこさー", "東京は遊園地みたいなところさー", 0, 1, 0, 0, 1, 1.4, 0, 0, "はいたーい。\n喜屋武香織さー。");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1, 1018, 2, "支倉 伊緒", "イオちゃんって呼んでね。", "先生って呼ばれるのは\nくすぐったいから", 0, 1, 0, 0, 1, 1.4, 0, 0, "支倉伊緒です。");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1, 1020, 2, "茜 ミミ", "ミミをおいてかないでぇ～", "あ！/\お兄ちゃ～ん\nまってよ～", 0, 1, 0, 0, 1, 1.5, 0, 0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1, 1021, 2, "栗林 くるみ", "ふぇぇぇぇぇん……", "あの……\nふぇ……", 0, 1, 0, 0, 1, 1.5, 0, 0, "あ…あの…えっと…\n栗…林…くるみ…です……");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1, 1022, 2, "風宮 より", "なんてありがとうございます！", "こんな私に貴重な時間を\n割いていただき、", 0, 1, 0, 0, 1, 1.4, 0, 0, "風宮よりです。\nあああああ！");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1, 1023, 2, "北条 綾音", "私こっち行きたいー\nね、早く早くー", "おにいちゃんどこいくの？\nえ？", 0, 1, 0, 0, 1, 1.5, 0, 0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1, 1025, 2, "天野 すずめ", "これて何か違う…\nあああすみません！", "ふ、不束者ですが\nどうぞ末永く…って、", 0, 1, 0, 0, 1, 1.4, 0, 0, "わっ…わっ…私、\n天野すずめといいます！");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1, 1027, 2, "倉石 恵理子", "離しませんわ………\n絶対に…!!", "あなたは…運命の……\n伴侶……", 0, 1, 0, 0, 1, 1.4, 0, 0, "……クスクス…私は\n…倉石恵理子……");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1, 1028, 2, "佐々木 咲恋", "…そうでしょ？？", "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0, 1, 0, 0, 1, 1.4, 0, 0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1, 1029, 2, "桜井 望", "あはは、\n私もまだまだだなぁ～", "ぇっと…\nキミ、私のこと知らないの?!", 0, 1, 0, 0, 1, 1.4, 0, 0, "桜井望だよ！\nよろしくねっ");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1, 1030, 2, "ニノン・ジュベール", "ショーグン、\nワタシと一緒に天下統一デース！", "初めまして、\n私はニノン・ジュベール申すデス！", 0, 1, 0, 0, 1, 1.4, 0, 0, "デケデケデンっ！");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1, 1031, 2, "上喜 しのぶ", "おかしいですね……", "でもって私の隣にいるのが……\nえ、見えない？", 0, 1, 0, 0, 1, 1.4, 0, 0, "上喜しのぶです。\n手元のドクロが父です。");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1, 1033, 2, "野戸まひる", "そう、\nオラのボケに突っ込める相方が…！", "けんども\nそれには足りないモンが…", 0, 1, 0, 0, 1, 1.5, 0, 0, "目指すはビッグな\nお笑い芸人だっぺ！");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1, 1034, 2, "綾瀬 ゆかり", "ちょ\nちょっと一杯飲んできます…！", "ちょっと緊張しちゃって…", 0, 1, 0, 0, 1, 1.4, 0, 0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1, 1036, 2, "氷川 鏡華", "これ以上お話しすることは…\nないです！", "知らない人とは話しちゃいけないので", 0, 1, 0, 0, 1, 1.5, 0, 0, "氷川鏡華…です");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1, 1038, 2, "柏崎 栞", "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", "……あ、アラーム。", 0, 1, 0, 0, 1, 1.4, 0, 0, "柏崎…栞です。");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1, 1040, 2, "双葉 碧", "野に咲く花が、\n唯一の話相手です。", "私、一人も友達がいなくて……", 0, 1, 0, 0, 1, 1.4, 0, 0, "ふ、双葉碧です。");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1, 1042, 2, "三角 千歌", "そう思っています。", "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 0, 1, 0, 0, 1, 1.4, 0, 0, "三角千歌です。");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1, 1043, 2, "安芸 真琴", "う、疑ってすまなかったな…", "あぁ？\nお前のそいつの仲間か？", 0, 1, 0, 0, 1, 1.4, 0, 0, "安芸真琴だ。");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1, 1044, 2, "イリヤ・オーンスタイン", "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", "生けとし生ける全ての者よ！", 0, 1, 0, 0, 1, 1.4, 0, 0, "わらわこそは夜を総べる者！");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1, 1045, 2, "遠見 空花", "ｌク、クウカに何かご用ですか!?", "ぐふふふふ……はっ！", 0, 1, 0, 0, 1, 1.4, 0, 0, "そこで騎士は妖精を乱暴に……");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1, 1046, 2, "宮坂たまき", "う～ん…\n猫ってホントに最高にゃ～♪", "自由気ままで♪\n寝て遊んで、食べてケンカして…", 0, 1, 0, 0, 1, 1.4, 0, 0, "宮坂たまきにゃ♪\n猫はいいにゃよ？");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1, 1048, 2, "大神 美冬", "…と思ったら\nバイトの時間だ！\nまたあとでね！", "それでは早速クエストに…", 0, 1, 0, 0, 1, 1.4, 0, 0, "大神美冬よ！");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1, 1049, 2, "星野静流", "お姉ちゃんがぜ～んぶ\nやってあげるからね！", "クエストもバトルも\n掃除も洗濯も", 0, 1, 0, 0, 1, 1.4, 0, 0, "星野静流だよ！");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1, 1050, 2, "玉泉美咲", "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", "見ての通りの\nセクシー美少女で", 0, 1, 0, 0, 1, 1.5, 0, 0, "アタシは玉泉美咲。");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1, 1052, 2, "リマ", "？？？？", "？？？？", 0, 1, 0, 0, 1, 1.4, 0, 0, "？？？");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1, 1053, 2, "モニカ・ヴァイスヴィント", "そ、そこまでいうなら\nもらってやる", "菓子でつろうなどと\n稚拙な策を……", 0, 1, 0, 0, 1, 1.5, 0, 0, "モニカ・ヴァイスヴィントだ。");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1, 1058, 2, "ペコリーヌ", "そ、そこまでいうなら\nもらってやる", "菓子でつろうなどと\n稚拙な策を……", 0, 1, 0, 0, 1, 1.5, 0, 0, "モニカ・ヴァイスヴィントだ。");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1, 1059, 2, "コッコロ", "そ、そこまでいうなら\nもらってやる", "菓子でつろうなどと\n稚拙な策を……", 0, 1, 0, 0, 1, 1.5, 0, 0, "モニカ・ヴァイスヴィントだ。");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1, 1060, 2, "キャル", "そ、そこまでいうなら\nもらってやる", "菓子でつろうなどと\n稚拙な策を……", 0, 1, 0, 0, 1, 1.5, 0, 0, "モニカ・ヴァイスヴィントだ。");
